import React from 'react';
import { MdBeachAccess } from 'react-icons';
import { Button } from 'react-bootstrap';
import './VacationButton.css'


const VacationButton = () => {

  return (
    <>
      <div className="pb-2 d-flex align-items-center ">
        <div className="btn-wrap">
          <button className="px-3">
            <div className="btn-disabled">
              휴가 신청 내역
            </div>
          </button>
        </div>
        <div className="btn-wrap">
          <button className="px-3">
            <div className="btn-disabled">
              <MdBeachAccess />휴가사용
            </div>
          </button>
        </div>
        {/* <Button variant="outline-secondary" className="me-3">휴가 신청 내역</Button> */}
        {/* <Button variant="primary">휴가사용</Button> */}
      </div>
    </>
  )
}

export default VacationButton;
